import { Link } from 'react-router-dom'
import ErorStyle from '../styles/404.module.css'

export function Erorpage() {
	return (
		<div className={ErorStyle.Container}>
			<div className={ErorStyle.Text}>
				<h1>404</h1>
				<p>Page not found</p>
				<Link to='Home'>Go back to Home</Link>
			</div>
		</div>
	)
}
